import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from "axios";

const LoginRegisterPage = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const navigate = useNavigate();

  const myMenuFunction = () => {
    // ... (your existing code)
  };

  const login = async () => {
    try {
      const res = await axios.post("http://localhost:8090/api/v1/employee/login", {
        email: email,
        password: password,
      });

      console.log(res.data);

      if (res.data.message === "Login Success") {
        navigate('/home');
      } else {
        alert("Incorrect Email and Password not match");
        // Remove the navigate('/home') line to prevent navigation on incorrect credentials
      }
    } catch (err) {
      console.error(err);
      alert("An error occurred during login");
    }
  };

  const register = () => {
    // ... (your existing code)
  };

  return (
    <div className="wrapper">
      {/* ... (your existing code) */}
      <nav className="nav">
        {/* ... (your existing code) */}
      </nav>

      <div className="form-box">
        {/* Login and registration forms */}
        <div className="login-container" id="login">
          {/* ... (your existing code) */}
          <div className="input-box">
            <input
              type="text"
              className="input-field"
              placeholder="Username or Email"
              value={email}
              onChange={(event) => setEmail(event.target.value)}
            />
            <i className="bx bx-user"></i>
          </div>
          <div className="input-box">
            <input
              type="password"
              className="input-field"
              placeholder="Password"
              value={password}
              onChange={(event) => setPassword(event.target.value)}
            />
            <i className="bx bx-lock-alt"></i>
          </div>
          <div className="input-box">
            <input type="submit" className="submit" value="Sign In" onClick={login} />
          </div>
          <div className="two-col">
            {/* ... (your existing code) */}
          </div>
        </div>

        <div className="register-container" id="register">
          {/* ... (rest of the registration form HTML code) ... */}
        </div>
      </div>
    </div>
  );
};

export default LoginRegisterPage;
